class EmailAuthBackend:
    """
    A unified authentication backend that can authenticate both the default Django
    ``User`` model and the custom ``Provider`` model using an e‑mail address.

    The public ``authenticate`` method accepts an optional ``model`` argument
    (``'django'`` or ``'provider'``).  If ``model`` is omitted the backend will
    first try the Django user model and then fall back to the ``Provider`` model.
    This design removes the four previously duplicated methods while keeping
    the same behaviour.
    """

    def _fetch_user(self, email: str, model_name: str):
        """
        Retrieve a user instance from the requested model.

        Parameters
        ----------
        email: str
            The e‑mail address used for lookup.
        model_name: str
            Either ``'django'`` or ``'provider'``.

        Returns
        -------
        User instance or ``None`` if not found.
        """
        try:
            if model_name == "django":
                return django_User.objects.get(email=email)
            # ``Provider`` stores the e‑mail on the related ``User`` (idUser.mail)
            return Provider.objects.filter(idUser__mail__icontains=email).first()
        except (django_User.DoesNotExist, Provider.DoesNotExist):
            return None

    def authenticate(self, request=None, username=None, password=None, model=None):
        """
        Authenticate a user based on e‑mail and (optionally) password.

        Parameters
        ----------
        request: HttpRequest, optional
            Unused but kept for compatibility with Django's authentication API.
        username: str
            The e‑mail address supplied by the user.
        password: str, optional
            The plain‑text password. If omitted, the method returns the user
            object (used by ``auth_email`` / ``auth_email2`` in the original code).
        model: str, optional
            ``'django'`` or ``'provider'`` to force a specific model. If ``None``,
            the backend will try the Django model first and then the Provider
            model.

        Returns
        -------
        User instance or ``None``.
        """
        if not username:
            return None

        # ------------------------------------------------------------------
        # Determine which model(s) to query
        # ------------------------------------------------------------------
        models_to_try = [model] if model in ("django", "provider") else ["django", "provider"]

        for model_name in models_to_try:
            user = self._fetch_user(username, model_name)
            if not user:
                continue

            # If a password is supplied, verify it; otherwise just return the user.
            if password is not None:
                if check_password(password, user.password):
                    return user
            else:
                return user

        # No matching user or password check failed
        return None


