def _find_run_dir(current_directory):
    """
    Walk up the directory tree looking for a lock file or a wscript.
    Returns the directory that should be used as the run directory.
    """
    # ------------------------------------------------------------------
    # 1) Look for a lock file – this gives us the saved run/top/out dirs.
    # ------------------------------------------------------------------
    cur = current_directory
    while cur:
        lst = os.listdir(cur)

        if Options.lockfile in lst:
            env = ConfigSet.ConfigSet()
            try:
                env.load(os.path.join(cur, Options.lockfile))
                ino = os.stat(cur)[stat.ST_INO]
            except Exception:
                pass
            else:
                load = False
                for x in [env.run_dir, env.top_dir, env.out_dir]:
                    if Utils.is_win32:
                        if cur == x:
                            load = True
                            break
                    else:
                        try:
                            ino2 = os.stat(x)[stat.ST_INO]
                        except OSError:
                            pass
                        else:
                            if ino == ino2:
                                load = True
                                break
                if not load:
                    Logs.warn('invalid lock file in %s' % cur)

                if load:
                    Context.run_dir = env.run_dir
                    Context.top_dir = env.top_dir
                    Context.out_dir = env.out_dir
                    break

        # ------------------------------------------------------------------
        # 2) No lock file – look for a wscript file.
        # ------------------------------------------------------------------
        if not Context.run_dir and Context.WSCRIPT_FILE in lst:
            Context.run_dir = cur

        # ------------------------------------------------------------------
        # 3) Move up one level unless climbing is disabled.
        # ------------------------------------------------------------------
        next_dir = os.path.dirname(cur)
        if next_dir == cur:
            break
        cur = next_dir

        # ``NOCLIMB`` environment variable or a command that forces a stop.
        no_climb = os.environ.get('NOCLIMB', None)
        if not no_climb:
            for k in no_climb_commands:
                if k in sys.argv:
                    no_climb = True
                    break
        if no_climb:
            break

    # ----------------------------------------------------------------------
    # If we still have not found a run directory, handle ``-h/--help`` or
    # abort with an error.
    # ----------------------------------------------------------------------
    if not Context.run_dir:
        if '-h' in sys.argv or '--help' in sys.argv:
            Logs.warn('No wscript file found: the help message may be incomplete')
            Context.run_dir = current_directory
            ctx = Context.create_context('options')
            ctx.curdir = current_directory
            ctx.parse_args()
